import './App.css';
import Kakao from './component/Kakao.js';
import Header from './component/Header';
import { BrowserRouter as Router } from 'react-router-dom';

function App() {
  return (
    <Router>
      <div className='App'>
        <Header/>
        <Kakao/>
      </div>
    </Router>
  );
}

export default App;
